import{_ as t}from"./chunks/v5_nano_01.DMHbymF9.js";import{_ as a,a as r}from"./chunks/cuav_nano_debug_cable.BXKuvqDb.js";import{_ as o,c as i,a8 as l,o as n}from"./chunks/framework.BDnHobkS.js";const v=JSON.parse('{"title":"Автопілот CUAV V5 nano","description":"","frontmatter":{},"headers":[],"relativePath":"uk/flight_controller/cuav_v5_nano.md","filePath":"uk/flight_controller/cuav_v5_nano.md"}'),s={name:"uk/flight_controller/cuav_v5_nano.md"};function d(c,e,p,h,u,m){return n(),i("div",null,e[0]||(e[0]=[l('<h1 id="автопілот-cuav-v5-nano" tabindex="-1">Автопілот CUAV V5 nano <a class="header-anchor" href="#автопілот-cuav-v5-nano" aria-label="Permalink to &quot;Автопілот CUAV V5 nano&quot;">​</a></h1><div class="warning custom-block"><p class="custom-block-title">WARNING</p><p>PX4 не розробляє цей (або будь-який інший) автопілот. Contact the <a href="https://store.cuav.net/" target="_blank" rel="noreferrer">manufacturer</a> for hardware support or compliance issues.</p></div><p><strong>V5 nano</strong><sup>®</sup> is an autopilot for space-constrained applications, designed by CUAV<sup>®</sup> in collaboration with the PX4 team.</p><p>Автопілот досить малий, щоб використовувати в гоночних дронах розміром 220 мм, але залишається достатньо потужним для більшості використань дрона.</p><p><img src="'+t+'" alt="V5 nano - Hero image"></p><div class="info custom-block"><p class="custom-block-title">INFO</p><p>The V5 nano is similar to the <a href="./../flight_controller/cuav_v5_plus.html">CUAV V5+</a>, but has an all-in-one form factor, fewer PWM ports (can&#39;t be used for <a href="./../airframes/airframe_reference.html">airframes</a> that use AUX ports), and does not have internal damping.</p></div><p>Деякі з його основних функцій включають:</p><ul><li>Full compatibility with the <a href="https://pixhawk.org/" target="_blank" rel="noreferrer">Pixhawk project</a> <strong>FMUv5</strong> design standard and uses the <a href="https://pixhawk.org/pixhawk-connector-standard/" target="_blank" rel="noreferrer">Pixhawk Connector Standard</a> for all external interfaces.</li><li>Більш продуктивний процесор, оперативна пам&#39;ять та флеш-пам&#39;ять, ніж у FMU v3, разом із більш стабільними та надійними датчиками.</li><li>Прошивка сумісна з PX4.</li><li>Велика відстань між контактами вводу/виводу 2,6 мм, що полегшує використання всіх інтерфейсів.</li></ul><div class="info custom-block"><p class="custom-block-title">INFO</p><p>This flight controller is <a href="./../flight_controller/autopilot_manufacturer_supported.html">manufacturer supported</a>.</p></div><h3 id="короткии-опис" tabindex="-1">Короткий опис <a class="header-anchor" href="#короткии-опис" aria-label="Permalink to &quot;Короткий опис&quot;">​</a></h3><p>Основний процесор FMU: STM32F765◦32 Bit Arm® Cortex®-M7, 216MHz, 2MB пам&#39;яті, 512KB RAM</p><ul><li><p>Бортові сенсори:</p><ul><li>Акселератор/гіроскоп: ICM-20689</li><li>Акселератор/гіроскоп: ICM-20602</li><li>Акселератор/гіроскоп: BMI055</li><li>Магнітометр: IST8310</li><li>Барометр: MS5611</li></ul></li><li><p>Інтерфейси: 8 виходів PWM</p><ul><li>3 виділених PWM/Capture входи на FMU</li><li>Виділений R/C вхід для CPPM</li><li>Виділений вхід R/C для Spektrum / DSM і S.Bus</li><li>Аналоговий / PWM вхід RSSI</li><li>4 загальних послідовних порти</li><li>3 I2C порти</li><li>4 шини SPI</li><li>2 CAN шини</li><li>Аналогові входи для напруги / струму з батареї</li><li>2 додаткових аналогових входи</li><li>Підтримка nARMED</li></ul></li><li><p>Система енергопостачання: вхід Power Brick: 4,75~5,5В</p></li><li><p>Вхід USB Power: 4.75~5.25V</p></li><li><p>Вага та розміри:</p><ul><li>Розміри: 60*40*14mm</li></ul></li><li><p>Інші характеристики:</p><ul><li>Робоча температура: -20 ~ 85°С (виміряне значення)</li></ul></li></ul><h2 id="де-купити" tabindex="-1">Де купити <a class="header-anchor" href="#де-купити" aria-label="Permalink to &quot;Де купити&quot;">​</a></h2><p><a href="https://store.cuav.net/shop/v5-nano/" target="_blank" rel="noreferrer">CUAV Store</a></p><p><a href="https://www.aliexpress.com/item/33050770314.html?storeId=3257035&amp;spm=2114.12010612.8148356.9.dbe6790bjW2hpH" target="_blank" rel="noreferrer">CUAV Aliexpress</a> (international users)</p><p><a href="https://item.taobao.com/item.htm?spm=a230r.1.14.8.26ab5258veQJRu&amp;id=569404317857&amp;ns=1&amp;abbucket=13#detail" target="_blank" rel="noreferrer">CUAV Taobao</a> (China Mainland users)</p><div class="info custom-block"><p class="custom-block-title">INFO</p><p>Autopilot may be purchased with included Neo GPS module</p></div><p><a id="connection"></a></p><h2 id="з-єднання-проводка" tabindex="-1">З&#39;єднання (Проводка) <a class="header-anchor" href="#з-єднання-проводка" aria-label="Permalink to &quot;З&#39;єднання (Проводка)&quot;">​</a></h2><p><a href="./../assembly/quick_start_cuav_v5_nano.html">V5 nano Wiring Quickstart</a></p><h2 id="схема-розташування-виводів" tabindex="-1">Схема розташування виводів <a class="header-anchor" href="#схема-розташування-виводів" aria-label="Permalink to &quot;Схема розташування виводів&quot;">​</a></h2><p>Download <strong>V5 nano</strong> pinouts from <a href="http://manual.cuav.net/V5-Plus.pdf" target="_blank" rel="noreferrer">here</a>.</p><h2 id="збірка-прошивки" tabindex="-1">Збірка прошивки <a class="header-anchor" href="#збірка-прошивки" aria-label="Permalink to &quot;Збірка прошивки&quot;">​</a></h2><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>Most users will not need to build this firmware! It is pre-built and automatically installed by <em>QGroundControl</em> when appropriate hardware is connected.</p></div><p>To <a href="./../dev_setup/building_px4.html">build PX4</a> for this target:</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>make px4_fmu-v5_default</span></span></code></pre></div><p><a id="debug_port"></a></p><h2 id="відладочнии-порт" tabindex="-1">Відладочний порт <a class="header-anchor" href="#відладочнии-порт" aria-label="Permalink to &quot;Відладочний порт&quot;">​</a></h2><p>The <a href="./../debug/system_console.html">PX4 System Console</a> and <a href="./../debug/swd_debug.html">SWD interface</a> operate on the <strong>FMU Debug</strong> port (<code>DSU7</code>). Плата не має інтерфейсу відладки вводу/виводу.</p><p><img src="'+a+'" alt="Debug port (DSU7)"></p><p>The debug port (<code>DSU7</code>) uses a <a href="https://www.digikey.com.au/product-detail/en/jst-sales-america-inc/BM06B-GHS-TBT-LF-SN-N/455-1582-1-ND/807850" target="_blank" rel="noreferrer">JST BM06B</a> connector and has the following pinout:</p><table tabindex="0"><thead><tr><th>Pin</th><th>Сигнал</th><th>Вольтаж</th></tr></thead><tbody><tr><td>1 (red)</td><td>5V+</td><td>+5V</td></tr><tr><td>2 (blk)</td><td>DEBUG TX (OUT)</td><td>+3.3V</td></tr><tr><td>3 (blk)</td><td>DEBUG RX (IN)</td><td>+3.3V</td></tr><tr><td>4 (blk)</td><td>FMU_SWDIO</td><td>+3.3V</td></tr><tr><td>5 (blk)</td><td>FMU_SWCLK</td><td>+3.3V</td></tr><tr><td>6 (blk)</td><td>GND</td><td>GND</td></tr></tbody></table><p>The product package includes a convenient debug cable that can be connected to the <code>DSU7</code> port. This splits out an FTDI cable for connecting the <a href="./../debug/system_console.html">PX4 System Console</a> to a computer USB port, and SWD pins used for SWD/JTAG debugging. The provided debug cable does not connect to the SWD port <code>Vref</code> pin (1).</p><p><img src="'+r+'" alt="CUAV Debug cable"></p><div class="warning custom-block"><p class="custom-block-title">WARNING</p><p>The SWD Vref pin (1) uses 5V as Vref but the CPU is run at 3.3V!</p><p>Деякі JTAG-адаптери (SEGGER J-Link) використовують напругу Vref для встановлення напруги на лініях SWD. For direct connection to <em>Segger Jlink</em> we recommended you use the 3.3 Volts from pin 4 of the connector marked <code>DSM</code>/<code>SBUS</code>/<code>RSSI</code> to provide <code>Vtref</code> to the JTAG (i.e. providing 3.3V and <em>NOT</em> 5V).</p><p>For more information see <a href="#using-jtag-for-hardware-debugging">Using JTAG for hardware debugging</a>.</p></div><h2 id="налаштування-послідовного-порту" tabindex="-1">Налаштування послідовного порту <a class="header-anchor" href="#налаштування-послідовного-порту" aria-label="Permalink to &quot;Налаштування послідовного порту&quot;">​</a></h2><table tabindex="0"><thead><tr><th>UART</th><th>Пристрій</th><th>Порт</th></tr></thead><tbody><tr><td>UART1</td><td>/dev/ttyS0</td><td>GPS</td></tr><tr><td>USART2</td><td>/dev/ttyS1</td><td>TELEM1 (керування потоком)</td></tr><tr><td>USART3</td><td>/dev/ttyS2</td><td>TELEM2 (керування потоком)</td></tr><tr><td>UART4</td><td>/dev/ttyS3</td><td>TELEM4</td></tr><tr><td>USART6</td><td>/dev/ttyS4</td><td>TX - RC-вхід з роз&#39;єму SBUS_RC</td></tr><tr><td>UART7</td><td>/dev/ttyS5</td><td>Debug Console</td></tr><tr><td>UART8</td><td>/dev/ttyS6</td><td>Не підключено (без PX4IO)</td></tr></tbody></table><h2 id="номінальна-напруга" tabindex="-1">Номінальна напруга <a class="header-anchor" href="#номінальна-напруга" aria-label="Permalink to &quot;Номінальна напруга&quot;">​</a></h2><p><em>V5 nano</em> must be powered from the <code>Power</code> connector during flight, and may also/alternatively be powered from <code>USB</code> for bench testing.</p><div class="info custom-block"><p class="custom-block-title">INFO</p><p>The <code>PM2</code> connector cannot not be used for powering the <em>V5 nano</em> (see <a href="#compatibility_pm2">this issue</a>).</p></div><div class="info custom-block"><p class="custom-block-title">INFO</p><p>The Servo Power Rail is neither powered by, nor provides power to the FMU. However, the pins marked <strong>+</strong> are all common, and a BEC may be connected to any of the servo pin sets to power the servo power rail.</p></div><h2 id="захист-від-перенапруги" tabindex="-1">Захист від перенапруги <a class="header-anchor" href="#захист-від-перенапруги" aria-label="Permalink to &quot;Захист від перенапруги&quot;">​</a></h2><p>The <em>V5 nano</em> has no over current protection.</p><p><a id="Optional-hardware"></a></p><h2 id="периферіині-пристроі" tabindex="-1">Периферійні пристрої <a class="header-anchor" href="#периферіині-пристроі" aria-label="Permalink to &quot;Периферійні пристрої&quot;">​</a></h2><ul><li><a href="https://item.taobao.com/item.htm?spm=a1z10.3-c-s.w4002-16371268452.37.6d9f48afsFgGZI%5C&amp;id=9512463037" target="_blank" rel="noreferrer">Цифровий датчик швидкості польоту</a></li><li><a href="https://cuav.taobao.com/category-158480951.htm?spm=2013.1.w5002-16371268426.4.410b7a821qYbBq%5C&amp;search=y%5C&amp;catName=%CA%FD%B4%AB%B5%E7%CC%A8" target="_blank" rel="noreferrer">Телеметричні радіо модулі</a></li><li><a href="./../sensor/rangefinders.html">Rangefinders/Distance sensors</a></li></ul><h2 id="підтримувані-платформи-конструкціі" tabindex="-1">Підтримувані платформи / Конструкції <a class="header-anchor" href="#підтримувані-платформи-конструкціі" aria-label="Permalink to &quot;Підтримувані платформи / Конструкції&quot;">​</a></h2><p>Будь-який мультикоптер / літак / наземна платформа / човен, який може керуватися звичайними RC сервоприводами або сервоприводами Futaba S-Bus. The complete set of supported configurations can be seen in the <a href="./../airframes/airframe_reference.html">Airframes Reference</a>.</p><h2 id="сумісність" tabindex="-1">Сумісність <a class="header-anchor" href="#сумісність" aria-label="Permalink to &quot;Сумісність&quot;">​</a></h2><p>CUAV використовує деякі відмінні дизайни і несумісний з деяким обладнанням, про що буде описано нижче.</p><p><a id="compatibility_gps"></a></p><h4 id="neo-v2-0-gps-несуміснии-з-іншими-пристроями" tabindex="-1">Neo v2.0 GPS несумісний з іншими пристроями <a class="header-anchor" href="#neo-v2-0-gps-несуміснии-з-іншими-пристроями" aria-label="Permalink to &quot;Neo v2.0 GPS несумісний з іншими пристроями&quot;">​</a></h4><p>The <em>Neo v2.0 GPS</em> that is recommended for use with <em>CUAV V5+</em> and <em>CUAV V5 nano</em> is not fully compatible with other Pixhawk flight controllers (specifically, the buzzer part is not compatible and there may be issues with the safety switch).</p><p>The UAVCAN <a href="http://doc.cuav.net/gps/neo-series-gnss/en/neo-v2-pro.html" target="_blank" rel="noreferrer">NEO V2 PRO GNSS receiver</a> can also be used, and is compatible with other flight controllers.</p><p><a id="compatibility_jtag"></a></p><h4 id="використання-jtag-для-апаратного-налагодження" tabindex="-1">Використання JTAG для апаратного налагодження <a class="header-anchor" href="#використання-jtag-для-апаратного-налагодження" aria-label="Permalink to &quot;Використання JTAG для апаратного налагодження&quot;">​</a></h4><p><code>DSU7</code> FMU Debug Pin 1 is 5 volts - not the 3.3 volts of the CPU.</p><p>Деякі JTAG-зонди використовують це напругу для встановлення рівнів введення-виведення при спілкуванні з цільовим об&#39;єктом.</p><p>For direct connection to <em>Segger Jlink</em> we recommended you use the 3.3 Volts of DSM/SBUS/RSSI pin 4 as Pin 1 on the debug connector (<code>Vtref</code>).</p><p><a id="compatibility_pm2"></a></p><h4 id="pm2-не-може-живити-модульнии-політнии-контролер" tabindex="-1">PM2 не може живити модульний політний контролер <a class="header-anchor" href="#pm2-не-може-живити-модульнии-політнии-контролер" aria-label="Permalink to &quot;PM2 не може живити модульний політний контролер&quot;">​</a></h4><p><code>PM2</code> can only measure battery voltage and current, but <strong>not</strong> power the flight controller.</p><div class="warning custom-block"><p class="custom-block-title">WARNING</p><p>PX4 does not support this interface.</p></div><h2 id="відомі-проблеми" tabindex="-1">Відомі проблеми <a class="header-anchor" href="#відомі-проблеми" aria-label="Permalink to &quot;Відомі проблеми&quot;">​</a></h2><p>The issues below refer to the <em>batch number</em> in which they first appear. Номер партії - це чотирицифрова дата виробництва за V01 та відображається на наклейці з боку контролера польоту. Наприклад, серійний номер партії V011904 ((V01 - це номер V5, 1904 - це дата виробництва, тобто номер партії).</p><p><a id="pin1_unfused"></a></p><h4 id="інтерфеис-sbus-dsm-rssi-pin1-не-захищении-від-перевантаження" tabindex="-1">Інтерфейс SBUS / DSM / RSSI Pin1 не захищений від перевантаження <a class="header-anchor" href="#інтерфеис-sbus-dsm-rssi-pin1-не-захищении-від-перевантаження" aria-label="Permalink to &quot;Інтерфейс SBUS / DSM / RSSI Pin1 не захищений від перевантаження&quot;">​</a></h4><div class="warning custom-block"><p class="custom-block-title">WARNING</p><p>This is a safety issue.</p></div><p>Будь ласка, не підключайте інше обладнання (крім RC приймача) до інтерфейсу SBUS / DSM / RSSI - це може призвести до пошкодження обладнання!</p><ul><li><em>Found:</em> Batches V01190904xxxx</li><li><em>Fixed:</em> Batches later than V01190904xxxx</li></ul><h2 id="подальша-інформація" tabindex="-1">Подальша інформація <a class="header-anchor" href="#подальша-інформація" aria-label="Permalink to &quot;Подальша інформація&quot;">​</a></h2><ul><li><a href="http://manual.cuav.net/V5-nano.pdf" target="_blank" rel="noreferrer">V5 nano manual</a> (CUAV)</li><li><a href="https://docs.google.com/spreadsheets/d/1-n0__BYDedQrc_2NHqBenG1DNepAgnHpSGglke-QQwY/edit#gid=912976165" target="_blank" rel="noreferrer">FMUv5 reference design pinout</a> (CUAV)</li><li><a href="https://github.com/cuav" target="_blank" rel="noreferrer">CUAV Github</a> (CUAV)</li><li><a href="./../frames_multicopter/dji_f450_cuav_5nano.html">Airframe build-log using CUAV v5 nano on a DJI FlameWheel450</a></li></ul>',72)]))}const k=o(s,[["render",d]]);export{v as __pageData,k as default};
